// import "~slick-carousel/slick/slick.css"; 
// import "~slick-carousel/slick/slick-theme.css";



// export default Card;

import React, { Component } from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import iphone from '../../img/11.jpg'
import samsung from '../../img/samsung.jpg'
import Moto from '../../img/moto.jpg'
import note from '../../img/note.jpg'
import oppo from '../../img/oppo.jpg'
import v from '../../img/v.jpg'
import i5 from '../../img/i5.jpg'
import down from '../Navbar/Down'

import '../../CSS/Style.css'
import "slick-carousel/slick/slick-theme.css";
export default function Mobile(){

      const settings = {
        
      dots: false,
      infinite: true,
      speed: 600,
      slidesToShow: 5,
      slidesToScroll: 1
    };

    const slidesData = [
        {
          image:iphone,
          name: 'I phone 11 ',
          pric:100000
        },
        {
            image :samsung,
            name: 'Samsung S15',
            pric:'15000' 
        },
        {
    
            image :Moto,
            name: 'Motorola G10',
            pric:'16000'
        }, {
            image :note,
            name: 'Redmi note 8 ',
            pric:18500
        }, {
      
            image :oppo,
            name: 'Oppo F15',
            pric:'32000 '
        },
        {
            image :v,
            name: 'Vivok V15',
            pric:33000
        },

        {
            image :i5,
            name: 'I Phone 5',
            pric:80000
        },

      ];
    
    return (
      <div className="grocerysection">
            <div className="container">
                <div className="row">
                    <div className="col-md-1">
                  
                    </div>
                    <div className="col-md-2">
                        <h2 className="topoffer">Mobile Phone</h2>
                        <hr className="hrline"/>
                    </div>
            </div>
      </div>
            <Slider {...settings} className="slickimg ">
                {slidesData.map((slide) =>
                    <div className="slick-slide">
                        <img src={slide.image} className="imggs" />
                        <p class="procutname">{slide.name}</p>
                        <p className="" id="price">Rs. {slide.pric}</p>
                    </div>
                )}
            </Slider>
            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320"><path fill="#fff" fill-opacity="1" d="M0,288L48,272C96,256,192,224,288,197.3C384,171,480,149,576,154.7C672,160,768,192,864,218.7C960,245,1056,267,1152,256C1248,245,1344,203,1392,181.3L1440,160L1440,0L1392,0C1344,0,1248,0,1152,0C1056,0,960,0,864,0C768,0,672,0,576,0C480,0,384,0,288,0C192,0,96,0,48,0L0,0Z"></path></svg>
            <down />
            
      </div>
    );
  
}
